import React from 'react';
import "../css/home.css"
const Home = () => {
    return (
        <div>
            <h1>Jeffrey Pernia</h1>
            <video autoPlay loop muted>
                <source src="/bg1.mp4" type="video/mp4" />
            </video>
        </div>
    )
}

export default Home;
